import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { Route, Routes, useLocation } from 'react-router-dom';
import Nav from './Nav/Nav';
import Home from './Home/Home';

function App() {

  const [userData, setUserData] = useState([]);
  const getUserData = () => {
    axios
      .get('https://captain-citizen-america.herokuapp.com/users')
      .then(res => {
        console.log(res.data);
        setData(res.data);
      })
      .catch(err => {
        console.log(err);
      })
  }
  useEffect(() => {
    getUserData();
  }, []);

  return (
    <div className="App">
      <nav className='nav'>

      </nav>

      <Home className='home'/>
    </div>
  );
}

export default App;
